1	How black holes are form?	how-black-holes-are-form	images/Default_simple_black_hole_view_from_very_far_side_with_do_not_3.jpg	<p>A<strong> black hole</strong> is a region in space where gravity is so intense that it forms an area with an escape velocity greater than the speed of light. As a result, nothing, not even light itself, can escape from within the black hole&#39;s boundary, known as the event horizon. The immense gravitational force of a black hole is caused by an extremely dense mass packed into a tiny volume, known as a singularity at the center. Black holes can come in various sizes, from small stellar-mass black holes formed from the collapse of massive stars to supermassive black holes found at the centers of galaxies, containing millions or even billions of times the mass of our Sun.</p>\r\n\r\n<h2><br />\r\n<strong>What is star?</strong></h2>\r\n\r\n<p>Star is body of hot,glowing gas that are born in nebulae.They vary enormously in size,mass,and temperature:diameter range from about 450 smaller to 1000 bigger that that of the Sun;masses range from about a twentieth to over 50 solar masses;and surface temperature range form about 3000 degree celcius to over 50000 degree celcius.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Life time of massive star:</strong></h2>\r\n\r\n<p>Massive stars have at least three times that of the Sun,and some stars are as massive as about 50 Suns.A massive star evolves in a similar way to a small stars until it reaches the main sequence stage.During its&nbsp; life as a main sequence star, it shines steadily until the hydrogen in its core has fused to form helium.This process takes billion of years in a small star,but only millions of years in a massive star.</p>\r\n\r\n<p>A massive star then becomes a red supergaint,which initially consist of helium core sorrounded by outer layers of cooling,expanding gas over the next few million years a series of nuclear reaction from differrent element in shells around an iron core eventually collapse in less than&nbsp; second causing massive explosion called <strong>supernova</strong>,In which a shock waves blows away the outer layer of the star.Supernova shine brighter&nbsp; than an entire galaxy for a short time.Sometimes the core survives&nbsp;&nbsp; the supernova explosion.</p>\r\n\r\n<p>If the surviving core is between about one and half and three solar masses,it contracts&nbsp; to became tiny dense <strong>Neutron star</strong>.If the core is greater than three solar masses,it contracts&nbsp; to became&nbsp; a &ldquo;<strong>black hole</strong>&rdquo;.</p>	2024-05-04 08:52:14.996558+00	3	8	2024-05-04	black hole,universe,space,star
4	4th state of matter.	4th-state-of-matter	images/plasma.png	<p><strong>Plasma </strong>is 4th state of matter.When the gas is heated in extreme level it convert into super ionized and super energetic.which,emits protons charges is simply called a new matter known as plasma.In plasma characterized by the presence of a significant portion of charged particles in any combination of ions or electrons.It is most ordinary matter in the <strong>Universe.</strong></p>\r\n\r\n<p>The plasma is produce in various things such as:</p>\r\n\r\n<ul>\r\n\t<li>Stars (including sun),</li>\r\n\t<li>Bulb(fluorecent bulb,neon light,etc.),</li>\r\n\t<li>thunderlight</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>update soooooon.....</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>	2024-05-05 10:29:57.567414+00	3	1	2024-05-05	science,plasma,4th state of matter,ionized gases
2	What is resistor?	what-is-resistor	images/What_is.png	<p><strong>Resistor</strong> is an electronic component.It is use to pass limit current in the circuit.it is made of special material resistance to flow of electricity.Resistor are use to various purpose like in electronic circuits such as controlling the amount of current or voltage in electronic circuit,dividing voltages and many other application. They comes in various shapes,sizes and color with difference resistance values.The resistance is measured in ohms (&Omega;).The resister are fundamental electrical component used to in analog and&nbsp; digital circuits.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>How resistor works?</h2>\r\n\r\n<p>Resistor are create friction for electrons to flowing through a electric circuit.The resistor&nbsp; converts some of electric energy into heat,which is why when we touch resistor can feel warm is in use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Material</strong> : Resistor are made form materials that conducting electricity poorly.These materials have high resistance,which create the harder to flow electron in resistor.The resistor made of material such as :-Carbon,Zinc etc.</p>\r\n\r\n<p><strong>Friction</strong> <strong>and</strong> <strong>Flow</strong> : The electrons try to push through in the resistor.The electrons collide to the atoms in the resistor.This collision lost some of there energy,reducing the current that flow in the resister.</p>\r\n\r\n<p><strong>Heat</strong> <strong>Generation</strong> : This collision converts electrical energy to heat.So,the&nbsp;&nbsp;&nbsp; temperature of resistor is more than to before and we can feel that resistor is warm.The amount of heat is depend on amount of voltage and resistance value of resistor.</p>\r\n\r\n<h2>Types of resistor:</h2>\r\n\r\n<p>There are two types main of resistor are as:-&nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>1.Fixed resistor</p>\r\n\r\n<p>2.Variable resistor</p>\r\n\r\n<ol>\r\n\t<li><strong>F</strong><strong>ixed<span style="font-size:14px"><strong> </strong></span>resistor</strong>: These types of resistor have specific resistance value cannot be adjusted.These type of resistor come in various types.Main types of resistor such as carbon film,metal film,wirewound and various other types.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Carbon composition:</strong> This types of resistor made of mixture carbon and ceremic,they expensive and widely use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Metal film:</strong> This is made of deposition a thin film of metal on a ceremic rode,They are more stability and accuracy than to carbon film resistor.</p>\r\n\r\n<p><strong>Wire wound:</strong> This types of resistor constructed by winding a resistance wire,typically it is made if nichrome and other alloy,around an ceremic or fibreglass core.</p>\r\n\r\n<p><strong>2.V</strong><strong>ariable<span style="font-size:14px"> </span>resistor</strong><strong>:</strong> This types of resistor are also known as potentiometer and rheostats,this types of are can adjustable resistance value.Various types of resistor such as potentiometer,rheostats,Light-Depented Resistor and other types.</p>\r\n\r\n<p><strong>Potentiometer: </strong>This types of resistor have three terminals 5v,output and ground.These resistor are used as voltage divider or adjusting the value of resistance.</p>\r\n\r\n<p><strong>Rheostats:</strong> These types of resistor have two-terminals variable used to control current in circuit.</p>\r\n\r\n<p><strong>Light-Depented Resistor(LDR&rsquo;s): </strong>These types of resistor also known as photoresistor.These types of resistor change their resistance based on the intensity of light that falling on them.They are use in light-sensitive application like street lights,light meters,control exposure of camera and other various electrical application.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>&nbsp;OHM&rsquo;s Law:</h2>\r\n\r\n<p>OHM&rsquo;s law describe relation between resistance,voltage,current is an&nbsp; electrical circuit</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 style="text-align:center">V=I&times;R</h3>\r\n\r\n<address>Where:</address>\r\n\r\n<p>V represents voltage, measured in volts (V).</p>\r\n\r\n<p>I represents current, measured in amperes (A).</p>\r\n\r\n<p>R represents resistance, measured in ohms (&Omega;).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>To determine the current:</p>\r\n\r\n<h3 style="text-align:center">I=V/R</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>To determine the resistance:</p>\r\n\r\n<h3 style="text-align:center">R=V/I</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>update soon..</p>	2024-05-04 10:35:37.712212+00	3	3	2024-05-05	resistor,electronics,electrical component
